import React from "react";
import styled from "styled-components";
import { motion } from "framer-motion";

const Container = styled.div`
  width: 100%;
  background-color: yellow;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;
const Box = styled.div`
  background-color: black;
  width: auto;
  height: auto;
  padding: 20px;
  border-radius: 10px;
`;
const Title = styled.h1`
    color: white ;
`
const Link = styled.p`
    color:white ;
`;
const FramerBoc = () => {
  return (
    <Container>
      <Box as={motion.div}>
        <Title as={motion.h2}>Framer Motion</Title>

        <Link>Link1</Link>
        <Link>Link2</Link>
        <Link>Link3</Link>
      </Box>
    </Container>
  );
};

export default FramerBoc;
